webpackJsonp([66359348515461],{2820:function(e,a){e.exports={pathContext:{docHtml:'<h1>lcid <a href="https://travis-ci.org/sindresorhus/lcid"><img src="https://travis-ci.org/sindresorhus/lcid.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Mapping between <a href="http://en.wikipedia.org/wiki/Locale">standard locale identifiers</a> and <a href="http://en.wikipedia.org/wiki/Locale#Specifics_for_Microsoft_platforms">Windows locale identifiers (LCID)</a></p>\n</blockquote>\n<p>Based on the <a href="https://github.com/python/cpython/blob/be2a1a76fa43bb1ea1b3577bb5bdd506a2e90e37/Lib/locale.py#L1395-L1604">mapping</a> used in the Python standard library.</p>\n<p>The mapping itself is just a <a href="lcid.json">JSON file</a> and can be used wherever.</p>\n<h2>Install</h2>\n<pre><code>$ npm install --save lcid\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var lcid = require(\'lcid\');\n\nlcid.from(1044);\n//=> \'nb_NO\'\n\nlcid.to(\'nb_NO\');\n//=> 1044\n\nlcid.all;\n//=> {\'af_ZA\': 1078, ...}\n</code></pre>\n<h2>License</h2>\n<p>MIT Â© <a href="http://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/lcid/readme",proj:"argo-ci"}}}});
